import Loader from '../Loader/Loader'

import {Wrapper, Content, Card, Image} from './ImageCarousel.styles'

export default function ImageCarousel({artists}) {

    return (
    <Wrapper>
        {artists && artists.length ? (
        <Content>
        {artists.map((artist, i) => (

          <Card key={i} className="image_carousel_container">
              {artist.images[0] && (
                  <Image className="carousel_image" src={artist.images[0].url}/>
              )}
          </Card>

        ))}
        </Content>
        ) : <Loader style={{opacity:'0.6'}}/>}
    </Wrapper>


        )
    }
